"text": "<div>\n<i class=\"NoteType\">\nEvent Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWhen the call came for volunteers from New York State to assist in the great Civil War, he answered the call by enlisting in August 1862, at the age of 19. He served with distinction until June, 1865, taking part in the battles of Gettysburg, Lookout Mountain and Mission Ridge, then joining the Western Army marching through Tennessee and Georgia. At Resaca, Georgia, he was wounded in 1864. In marching from Savannah to Goldsboro in 1865, he was taken prisoner, and placed in Libby Prison at Richmond, Virginia for 19 days. He was then placed in a parole camp for two weeks, at length of which time he received a furlough for thirty days. He received his discharge at Annapolis, Maryland at the close of the War in 1865.\n</p>\n<p>\nHere was a family coming to the United States in 1841, and only twenty-one years later sending one of its sons to fight in an internal war. Like most of the northern immigrants, Christopher Fisher fought on the side of the Union.\n</p>\n</div>\n</div>",
"type": "Military Service"
